import Link from 'next/Link';
const Navigation = () => {
    return(
        <ul>
            <li> <Link href="/"><a>Index</a></Link></li>
            <li> <Link href="/about"><a>About</a></Link></li>
            <li> <Link href="/services"><a>services</a></Link></li>
        </ul>
    )
}
export default Navigation;
